import React, { useEffect, useState } from 'react';
import { useAuth } from '../../AuthContext';
import { useNavigate } from 'react-router-dom';
import './../employee/css/EmployeeDashboardPage.css'; // Your styles
import Navbar from '../../components/EmployeeNavbar'; // Make sure the path is correct

function EmployeeDashboardPage() {
  const { user } = useAuth();
  const navigate = useNavigate();

  const [transactions, setTransactions] = useState([]);
  const [selectedTransaction, setSelectedTransaction] = useState(null);
  const [isModalOpen, setIsModalOpen] = useState(false);

  useEffect(() => {
    // Fetch all transactions on page load
    const fetchTransactions = async () => {
      const response = await fetch('https://localhost:7150/api/Transactions');
      const data = await response.json();
      setTransactions(data);
    };
    fetchTransactions();
  }, []);

  const openModal = (transaction) => {
    setSelectedTransaction(transaction);
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
    setSelectedTransaction(null);
  };

  const handleVerify = async () => {
    const updatedTransaction = { ...selectedTransaction, status: 'Verified' };

    // Call the API to update the status of the transaction
    const response = await fetch(`https://localhost:7150/api/Transactions/${selectedTransaction.id}`, {
      method: 'PUT',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(updatedTransaction),
    });

    if (response.ok) {
      setTransactions((prev) => prev.map((txn) => txn.id === selectedTransaction.id ? updatedTransaction : txn));
      closeModal();
    } else {
      alert('Failed to verify transaction');
    }
  };

  <>
  <Navbar userType="Customer" />
  <div className="dashboard-container">
    <h2>Customer Dashboard</h2>
    <h3>Welcome, {user?.fullName}</h3>

    {success && <Notification message={success} type="success" />}
    {error && <Notification message={error} type="error" />}

    <h3>Transaction History</h3>
    <button onClick={toggleModal}>Add New Transaction</button>

    <table>
      <thead>
        <tr>
          <th>Amount</th>
          <th>Currency</th>
          <th>Provider</th>
          <th>Status</th>
        </tr>
      </thead>
      <tbody>
        {transactions.map(transaction => (
          <tr key={transaction.id}>
            <td>{transaction.amount}</td>
            <td>{transaction.currency}</td>
            <td>{transaction.provider}</td>
            <td>{transaction.status}</td>
          </tr>
        ))}
      </tbody>
    </table>

    {isModalOpen && (
<div className="modal">
<div className="modal-content">
  <h3>Initiate a New Payment</h3>
  <h4>Welcome, {user?.id}</h4>
  <form onSubmit={handleSubmit}>
    <div>
      <label>Amount</label>
      <input
        type="number"
        name="amount"
        value={newTransaction.amount}
        onChange={handleInputChange}
        placeholder="Enter amount"
        required
      />
    </div>
    <div>
      <label>Currency</label>
      <select
        name="currency"
        value={newTransaction.currency}
        onChange={handleInputChange}
        required
      >
        <option value="USD">USD</option>
        <option value="EUR">EUR</option>
        <option value="GBP">GBP</option>
        <option value="ZAR">ZAR</option>
        {/* Add more currencies as needed */}
      </select>
    </div>
    <div>
      <label>Provider</label>
      <input
        type="text"
        name="provider"
        value="SWIFT"
        readOnly
      />
    </div>
    <div>
      <label>SWIFT Code</label>
      <input
        type="text"
        name="swiftCode"
        value={newTransaction.swiftCode}
        onChange={handleInputChange}
        required
      />
    </div>
    <button type="submit">Pay Now</button>
  </form>
  <button onClick={toggleModal}>Close</button>
</div>
</div>
